webpackJsonp([0xa4e69b2c07f9],{2829:function(e,a){e.exports={data:{challengeNode:{title:"Create an ES6 JavaScript Map",description:["新版 JavaScript 为我们提供了内置的 Map 对象，该 Map 对象提供了上一次挑战中我们手写的大部分方法。但是 Map 对象相比一般的 JavaScript 对象提供了更多的方法。例如，ES6 的 Map 可以追溯元素添加进 Map 的顺序。下面是 Map 内置方法的概览：","<code>.has(key)</code>根据 key 值存在与否返回 true 或 false；","<code>.get(key)</code>返回 key 值对应的 value 值；","<code>.set(key, value)</code>添加一组新的键值对；","<code>.delete(key)</code>移除一个键值对；","<code>.clear()</code>移除所有的键值对；","<code>.entries()</code>以数组形式返回所有 key 值，顺序以插入时的顺序为准；","<code>.values()</code>以数组形式返回所有 value 值，顺序以插入时的顺序为准。","任务：定义一个 Map 对象并将其赋值给一个名为 myMap 的变量。你还需要给 Map 对象添加键值对<code>freeCodeCamp</code>,<code>Awesome!</code>。"],challengeType:1,fields:{slug:"/coding-interview-prep/data-structures/create-an-es6-javascript-map",blockName:"Data Structures",tests:[{text:"myMap 对象应存在。",testString:"assert(typeof myMap === 'object', 'myMap 对象应存在。');"},{text:"myMap 应包含键值对<code>freeCodeCamp: 'Awesome!'</code>。",testString:"assert(myMap.get('freeCodeCamp') === 'Awesome!', 'myMap 应包含键值对<code>freeCodeCamp</code>,<code>Awesome!</code>。');"}]},required:[],files:{indexhtml:null,indexjs:{key:"indexjs",ext:"js",name:"index",contents:"// 请把你的代码写在这条注释以下",head:"",tail:""},indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/coding-interview-prep/data-structures/create-a-hash-table",id:"587d825b367417b2b2512c8d"},slug:"/coding-interview-prep/data-structures/create-an-es6-javascript-map"}}}});
